  [],\n\t\"revision_timestamp\": \"2015-05-07T00:56:07.749795\",\n\t\"name\": \"behavior-tracking-software-enhancement-and-integration-of-a-feedback-module-project-cd499\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Horizon Performance designed a Behavior
  Tracking Software System to collect crew member behavior throughout a mission, giving
  NASA the capability to monitor behavioral patterns that may identify if crews are
  at increased risk related to interpersonal or psychosocial problems. Building upon
  the alpha version of the software developed as a part of the Phase I SBIR, the proposed
  software will allow crewmembers and/or personnel watching video footage to periodically
  document salient crewmember behaviors which will then be used to identify behavioral
  patterns. When a behavioral pattern is identified and deemed important to investigate,
  users would be able to review all collected data. Furthermore, this software includes
  an integrated feedback module that offers automated reports based on identified
  behavioral patterns. Flight surgeons can create a knowledge base of feedback based
  on specific attributes or behavioral patterns, and the software will then generate
  automated feedback reports based upon identified attributes or behavioral patterns.
  Flight surgeons will be able to: 1) generate a variety of reports that describe
  crew member behavioral patterns; 2) use the behavioral timestamps to view incidents
  of behaviors on video footage; 3) compare behaviors with other data (e.g., performance
  reports); and, 4) generate feedback reports. \",\n\t\"license_title\": \"U.S. Government
